        {
          userImg: CardIconImg,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
      ],
    },
  ];

  return (
    <>
      <div className="custom_container">
        <UserName />
        <PagesTopTitle title="dashbaord" />

        <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
          <InfoCard />
          <EmployeesChart />
          <WorkingFormatChart />
          <WhoAwayApp />
          <CelebrationsApp />
          <HolidaysApp />
          <CalendarApp />
          <WorkingTimeChart />
        </div>
        <PagesTopTitle title="Request for Approvals" />
        <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
          <ApprovalsCard
            data={ApprovalsCardData}
            title="Reimbursement"
            pagelink="/test"
